import './App.scss';
import styled from 'styled-components';
import { Header } from './components/Header';
import { Main } from './components/Main';
import { Footer } from './components/Footer';
import { Circle } from './components/Circle';

const AppWrapper = styled.div`
    max-width: 1140px;
    width: 100%;
    height: 100%;
    margin: 0 auto;
`

export function App() {
  return (
    <main>
        <AppWrapper>
            <Header/>
            <Main/>
            <Footer/>
            <Circle left={'-1000px'} top={'20px'} color={'red'} width={'311px'} height={'311px'} border={'50%'} opacity={'1'} filter={'drop-shadow(-102px 251px 0.75rem crimson)'}/>
            <Circle/>
            <Circle/>
            <Circle/>
            <Circle/>
        </AppWrapper>
    </main>
  );
}
